import { useState, useEffect } from 'react'
import './App.css'
import { search } from './services/lyrics'

function App() {
  const [result, setResult] = useState(null)

  useEffect(() => {
    async function fetchMyAPI() {
      let response = await search('Pain three')
      setResult(response)
    }

    fetchMyAPI()
  }, [])

  return (
    <ul>
      {result &&
        result.map(song => 
          <li key={song.result.id}> {song.result.full_title} </li>
        )
      }
    </ul>
  );
}

export default App;
